descr:
Notifico que os seguintes laudos de analises foram entregues neste estabelecimentos. 
laudo numero 1529.1P.0/2018 do produto condicionador mega hidratante studio hair deita cabelo com resultado INSATISFATORIO somente para o rotulo; 
laudo numero 1531.1P.0/2018 do produto creme para pentear oleo de coco com resultado SATISFATORIO para todas as analises.
